import React from 'react'
import './segunda.css'
import ReactDOM from 'react-dom'

class Input extends React.Component {
    constructor (){
        super();
        this.state = {
            digite:""
        };
    }
}

function Segunda() {
    
    
    return(
        <div className="painel">
            <input className="segunda" type="text" />
        </div>
        
        
    );
}
export default Segunda;
